  [],\n\t\"revision_timestamp\": \"2016-07-27T22:37:58.460661\",\n\t\"name\": \"usfws-r1-fire-management-hazardous-fuels-treatment-geodatabase\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The shapefile was created by Molly Cox,
  a contract worker with ApTech, Inc. in the fall and winter of 2010 and 2011. National
  Wildlife Refuge Fire Management staff from each fire management zone sent Molly
  individual polygon shapefiles, hand-drawn maps, and computerized maps of hazardous
  fuels treatments completed in fiscal year 2010, to be included into the regional
  shapefile.  Refuge staffs were responsible for sending in polygons with their associated
  National Fire Plan and Operations System (NFPORS) unique identification number (treatment
  ID). NFPORS is an interagency system designed to assist field personnel in managing
  and reporting accomplishments for work conducted under the National Fire Plan. Attribute
  information include the NFPORS treatment ID, Unit_ID (fire management station/national
  wildlife refuge where treatment occurred), notes (polygon collection method), and
  all fields/attributes found within the NFPORSu2019 Hazardous Fuels Reduction Treatment
  Details Report. A Treatment Details Report was downloaded for each National Wildlife
  Refuge into a master regional Excel spreadsheet and joined within the shapefileu2019s
  attribute table.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
